import OpenCourse from "../pages/OpenCourse";
import {Link} from "react-router-dom";
import Spider from "../img/SPIDER.jpg"

const CourseTiles=()=>{
    return(

        <Link to="/OpenCourse" >
        <div className="flex m-4 flex-col  h-60 w-72 rounded-sm ">
            <div className=" border-white  bg-black w-72">
                    <img src={Spider} className=" h-40 w-72"></img>
            </div>
            <div className=" h-20 w-72 bg-black">
                
            </div>
        </div>
        </Link>
        
        
    )
}

export default CourseTiles;
